import './App.css';
import { BrowserRouter, Switch, Route } from "react-router-dom";
import { routes } from './route';
import LogIn from "./Component/pageJoin/LogIn";
import ChatPage from "./Component/pageChat/PageChat";
// import CommonLayout from "./Component/CommonLayout";

function App() {

  const displayPages = (listPage) => {
    return listPage.map((page) => {
      console.log(page);
      return <Route 
      key={ page.name}
      exact = {page.exact}
      path={page.path}
      render = { () => <page.component/>}
      />
    }) 
  }

  return (
    <BrowserRouter>
      <Switch>
      {displayPages(routes)}
      {/* <Route exact={true} path="/" component={LogIn}/>
      <Route exact={true} path="/chatpage" component={ChatPage}/> */}
      </Switch>
    </BrowserRouter>
  );
}

export default App;
